how to save large html content (article) in mongoDB collection field?<p>I want to save the large html content in mongodb but it doesn't allow to save more than 1 kb of content in single field of collection. 
Basically i am building a article submission web app using NUXT &amp; database i choose is Mongodb. Now i am stuck in this crucial task. </p>

<p>any help would be great!</p>

<pre><code>var mongoose = require('mongoose');
var ArticleSchema = new mongoose.Schema({
    title : { type : String , unique : true, required : true},
    description: { type : String , unique : true, required : true},
    content: { type : String , unique : true, required : true},
    banner: { type : String },
    active: { type: Boolean, default: false },
    created_date: { type: Date, default: Date.now },
    updated_date: { type: Date, default: Date.now },
    postedBy: {
        type : Object , required : true
    },
    comments: [{
        text: String,
        postedBy: {
            type : Object , required : true
        }
    }]
  });
module.exports = mongoose.model('Article', ArticleSchema);
</code></pre>

<p>Getting this error while saving large content:</p>

<pre><code>Btree::insert: key too large to index, failing tech-expert.articles.$content_1 3500 { : \"&lt;p&gt;Here is Sample text!Here is Sample text!Here is Sample text!Here is Sample text!Here is Sample text!Here is Sample text!Here is Sample text!Here is...\" }"}
</code></pre>

