Jest Unit Testing Returning "MongoError: topology was destroyed"<p>I am trying to use Jest for running unit tests with my Node.js app.</p>

<p>I have created a setup script to close the mongoose connection by calling the <code>afterAll()</code> function.</p>

<p>The issue I am having is that after running a unit test, the error <code>MongoError: topology was destroyed</code> is displayed in the console.</p>

<p>I believe this to be an issue with how I'm implementing asynchronous functions... maybe I'm not waiting long enough to return a promise? See the code below.</p>

<p>Jest Config (package.json):</p>

<pre><code>"jest": {
    "testEnvironment": "node",
    "setupFilesAfterEnv": [
      "./tests/setup.js"
    ]
  },
</code></pre>

<p>Setup Script (./tests/setup.js):</p>

<pre><code>const mongoose = require("mongoose");
const config = require("../config/config");

beforeAll(async function() {
    // Define database credentials.
    let dbUser = encodeURIComponent(config.db.username);
    let dbPass = encodeURIComponent(config.db.password);
    let dbDatabase = encodeURIComponent(config.db.database);
    let mongoUri = `mongodb://${dbUser}:${dbPass}@${config.db.host}:${config.db.port}/${dbDatabase}`;

    // Connect to the database.
    await mongoose.connect(mongoUri, { useNewUrlParser: true }, function(err) {
        if(err) throw err;
    });
});

beforeEach(async function() {
    // Clear the database.
    await mongoose.connection.dropDatabase(function(err) {
        if(err) throw err;
    });
});

afterAll(async function() {
    // Terminate the database connection.
    mongoose.connection.close(function(err) {
        if(err) throw err;
    });
});
</code></pre>

<p>Unit Test (./tests/models/api_session.test.js):</p>

<pre><code>const ApiSession = require("../../app/models/api_session");

