        //  and returns an object. Whatever the value of ‘_id’                
        //  is for an object inside an array is now the key for 
        //  that object in a new state object.

    case GET_POST:
      return { ...state.post, [action.payload._id]: action.payload };

        //  Changing to action.payload.ID results in an undefined 
        //  record being created in posts.
        //   { posts: {
        //       undefined: {
        //         _id: '5d1de8e47691dc12cc64b05c',
        //         title: 'xxxxxxxxx',       
        //         user: '5d1129e503da62058a95c481' }}}

    default:
      return state;
  }};
</code></pre>

<p><strong>POSTLIST COMPONENT</strong></p>

<pre><code>import React, { Component } from 'react';
import { connect } from 'react-redux';
import { Link } from 'react-router-dom';
import { getPosts } from '../actions';

class PostsList extends Component {

  componentDidMount() {
    this.props.getPosts(); }

  renderPosts() {
    return this.props.posts.map(post =&gt; {
      return (
        &lt;div className="content" key={post._id}&gt;
          &lt;h4 className="title"&gt;
            &lt;Link className="title" to={`/posts/${post._id}`}&gt;
              {post.title}
            &lt;/Link&gt;
          &lt;/h4&gt;
        &lt;/div&gt;
      );});}

  render() {
    return (
      &lt;div className="content-top"&gt;
        &lt;div&gt;{this.renderPosts()}&lt;/div&gt;
      &lt;/div&gt;
    );}}

const mapStateToProps = state =&gt; {
  return {
    posts: Object.values(state.posts)
  };};

export default connect(
  mapStateToProps,
  { getPosts }
)(PostsList);
</code></pre>; Answer: Well, conceptually, you basically need to know which "frame" to display. In order to know that, you need to know at what point you're up to in the animation cycle (so you know which frame to use, based on your desired FPS), maybe something like [this](http://stackoverflow.com/questions/27933159/how-to-draw-an-bufferedimage-to-a-jpanel/27933189#27933189)

